<script>
import CambiarEstado from "./CambiarEstado";
import CambiarEstadoDet from "./CambiarEstadoDetalle";

export default {
  name: "ListMovimiento",
  components: {
    CambiarEstado,
    CambiarEstadoDet,
  },
  data() {
    var fecha = new Date();
    return {
      CodDet: 0,
      Cod: 0,
      lista: {
        desde:
          fecha.getFullYear() +
          "-" +
          (fecha.getMonth() + 1) +
          "-" +
          fecha.getDate(),
        hasta:
          fecha.getFullYear() +
          "-" +
          (fecha.getMonth() + 1) +
          "-" +
          fecha.getDate(),
        descripcion: "",
      },
      movs: [],
      page: 1,
      loading: false,
      perPage: 10,
      buscador: "",
    };
  },

  computed: {
    mostrarMov() {
      var listando = this.movs.filter((mov) =>
        mov.Descripcion.toLowerCase().includes(this.buscador.toLowerCase())
      );
      let start = (this.page - 1) * this.perPage;
      let end = start + this.perPage;
      this.loading = false;

      return listando.slice(start, end);
    }
  },
  mounted() {
    this.getDataTable();
  },

  methods: {
    EnviarId(index) {
      this.Cod = index;
      // this.movs.splice(index, 1);
    },
    getDataTable() {
      var params = {
        desde: this.desde,
        hasta: this.hasta,
        descripcion: "",
        estado: 1,
      };

      this.loading = true;
      this.movs = [];
      if (this.lista.desde) {
        params.desde = this.lista.desde.split("-").reverse().join("/");
        if (this.lista.hasta) {
          params.hasta = this.lista.hasta.split("-").reverse().join("/");
        }
      }

      var url = new URL("http:localhost:3000/api/tasks/listar");

      Object.keys(params).forEach((key) =>
        url.searchParams.append(key, params[key])
      );

      fetch(url)
        .then((res) => res.json())
        .then((data) => {
          // console.log(data[0])
          this.movs = this.movs.concat(data[0]);
        })
        .catch((err) => {
          console.log(err);
        });
    },
    EnviarIdListar(index) {
      this.CodDet = index;
    },
    prevPage() {
      this.loading = true;
      this.page--;
    },
    nextPage() {
      this.lastPage();
      this.loading = true;
      this.page++;
    },
    lastPage() {
      let length = this.movs.length;
      let size = length / this.perPage;

      return size < 1 ? 1 : size % 1 > 0 ? size - (size % 1) + 1 : size;
    },
  },
};
</script>
