<script>
import Chart from "./Chart";

export default {
  name: "Dashboard",
  components: { Chart },
  data: () => ({
    loaded: false,
    chartdata: null,
    respuesta: null,
  }),
  mounted() {
    this.dashGet();
  },
  methods: {
    async dashGet() {
      await fetch("api/tasks/dashboard", { method: "GET" })
        .then((res) => res.json())
        .then((data) => {
          this.respuesta = data;
          this.chartdata = {
            labels: this.respuesta.map((item) => item.Descripcion),
            datasets: [
              {
                label: "Record Economico",
                data: this.respuesta.map((item) => item.total),
                backgroundColor: "#0074FC",
                //este es para el color al realizar hover en una barra
                hoverBackgroundColor: "white",
                //este es para el grosor de barra
                //barPercentage:0.3
                barPercentage: 0.1,
                barThickness: 6,
                maxBarThickness: 8,
                minBarLength: 4,
              },
            ],
          };
        });
      console.log(this.chartdata);
      this.loaded = true;
    },
  },
};
</script>
